import React from 'react';
import './App.css';

function login() {
  return (
      
    <div class="container">
        <div class="row justify-content-center">
            <div class="col-md-8">
                <div class="card">
                    <div class="card-header">Login</div>
                    <div class="card-body">
                        
                    </div>
                </div>
            </div>
        </div>
	</div>
  );
}

export default login;
